(9, 'CustomErrorLog', '2013-11-03 22:36:53', '2013-11-03 22:36:53', 'SRS (opmaak)', 'Object creation: TaskLog - Details: TITLE-SRS (opmaak), DESCRIPTION-Knoeien aan de layout van het SRS document terwijl Fernando en Tim inhoud opleverde.\nWat valt er onder knoeien te verstaan:\n- herschikken tex-files\n- opzoekingswerk (om zaken gedaan te krijgen)\n- zoektocht naar modulariteit van de componenten\n- erachter komen dat sharelatex de nodige package niet bezit hiervoor\n- die mensen mailen in de hoop dat ze het zullen installeren\n- hard coderen van inclusions\n- gedoe met tabellen fixen (ze zaten gedurig door elkaar gegooid)\n- uiteindelijk terug een compileerbaar en leesbaar document bekomen, FROM-Sun, 03 Nov 2013 16:00:00 GMT, TO-Sun, 03 Nov 2013 21:20:00 GMT, BY-Youri.', 0, 0),
