INSERT INTO `Requirement` (`ID`, `ClassName`, `Created`, `LastEdited`, `ReqID`, `Title`, `Priority`, `Prerequisities`, `Description`, `Status`) VALUES
(1, 'Requirement', '2013-11-04 03:17:01', '2014-03-18 16:05:33', 'FR1.01', 'Profiel aanmaken', 'high', NULL, 'Gebruiker zal zijn persoonlijke informatie moeten ingeven:\r\n• Naam\r\n• Voornaam\r\n• Gebruikersnaam\r\n• Wachtwoord\r\n• Geboortedatum\r\n• E-mail\r\n• Rolnummer\r\n• Richting (= vaste lijst) • Gewenste taal', 'done'),
(2, 'Requirement', '2013-11-04 03:35:23', '2014-03-18 16:05:42', 'FR1.02', 'Aanmelden', 'high', 'Gebruiker moet profiel bezitten', 'Gebruiker vult zijn username en wachtwoord in en klikt op “aanmelden”', 'done'),
(3, 'Requirement', '2013-11-04 03:35:59', '2014-03-18 16:05:50', 'FR1.03', 'Wachtwoord vergeten', 'medium', 'Gebruiker moet profiel bezitten', 'Mocht een gebruiker zijn wachtwoord vergeten, dan moet deze e-mail invoeren. Hierna zal een e-mail met een reset link verstuurd worden naar het ingevoerde e-mail adress. Als e-mail adress niet bestaat dient er een error bericht gegeven te worden aan de gebruiker', 'done'),
(4, 'Requirement', '2013-11-04 03:37:26', '2014-03-18 16:05:58', 'FR1.04', 'Ingeschreven vakken aanpassen', 'high', NULL, 'Een aangemelde student kan de vakken waarvoor deze is ingeschreven tijdelijk aanpassen. Dit betekent dat de aangemelde student zich kan uitschrijven voor vakken waar hij op ingeschreven is en zich kan inschrijven voor vakken waarvoor hij nog niet is ingeschreven.', 'done'),
(5, 'Requirement', '2013-11-04 03:38:15', '2014-03-18 16:06:06', 'FR1.05', 'Taal aanpassen', 'low', NULL, 'Een aangemelde gebruiker kan zijn taal van voorkeur aanpassen zodat de applicatie wordt weergegeven in een andere taal.', 'done'),
(6, 'Requirement', '2013-11-04 03:40:25', '2014-03-18 16:06:16', 'FR1.06', 'Afmelden', 'high', NULL, 'Een aangemelde gebruiker moet zijn sessie kunnen be ̈eindigen door zich af te melden.', 'done'),
(7, 'Requirement', '2013-11-04 03:41:10', '2014-03-18 16:07:32', 'FR2.01', 'Ingeschreven vakken bekijken', 'high', NULL, 'Een aangemelde student kan ten alle tijden de lijst van vakken zien waarvoor deze is ingeschreven. De student drukt hiervoor op een knop getiteld “Ingeschreven Vakken” en wordt dan naar een pagina doorgestuurd waarop deze in lijstvorm te zien zijn.', 'done'),
(8, 'Requirement', '2013-11-04 03:41:41', '2014-03-31 22:50:39', 'FR2.02', 'Notificaties van last-minute veranderingen', 'medium', NULL, 'Mocht er een lesaanpassing plaats vinden (bijv.: een professor die de les van lokaal verandert) dan moeten de gebruiker die dat vak volgen of geven verwittigd worden. Zij zullen dan een bericht op hun e-mail adres ontvangen met daarin de nodige informatie over de lesaanpassing.', 'busy'),
(9, 'Requirement', '2013-11-04 03:42:05', '2014-03-31 22:53:35', 'FR2.03', 'Last-minute tijdstip vak aanpassen', 'medium', NULL, 'Een gebruiker (van type toegang) heeft de optie om het tijdstip van een vak last-minute aan te passen. Enkel toegelaten als deze gebrui- ker de les zelf geeft of de programmabeheerder is. De gebruiker drukt dan op de knop getiteld “Lesuur aanpassen” en wordt dan gevraagd om een nieuwe dag en een tijdstip uit te kiezen. Hierna wordt dan een e-mail gestuurd naar alle studenten die dat vak volgen met het nieuwe tijdstip van het vak.', 'busy'),
(10, 'Requirement', '2013-11-04 03:42:29', '2014-03-31 22:58:49', 'FR2.04', 'Locatie les aanpasen', 'medium', NULL, 'Een professor heeft de optie om de locatie van een vak aan te passen. De professor drukt dan op de knop getiteld “Lokaal aanpassen” en wordt dan gevraagd om een nieuwe locatie uit te kiezen, deze locatie is dan van de vorm G.V.L (met G = gebouw, V = verdieping en L = lokaal). De Scheduler zal dan nagaan of het ingevoerde lokaal vrij is op het tijdstip van het vak. Keurt de Scheduler het nieuwe lokaal goed, dan wordt er een e-mail gestuurd naar alle studenten die het vak volgen met daarin het nieuwe lokaal van het vak. Keurt de Scheduler het nieuwe lokaal af, dan wordt de professor gevraagd een ander lokaal in te geven.', 'busy'),
(11, 'Requirement', '2013-11-04 03:43:40', '2014-04-22 12:14:54', 'FR2.05', 'Details vak aanpassen', 'low', NULL, 'Een professor kan de beschrijving en details van een vak aanpassen. Hiervoor zal er een knop getiteld “Aanpassen” zijn, waarna de pro- fessor vrij is in het aanpassen van de details.', 'done'),
(12, 'Requirement', '2013-11-04 03:44:07', '2014-04-22 12:11:51', 'FR2.06', 'Detail formulier nieuw vak indienen', 'low', NULL, 'Mocht er nood zijn aan het toevoegen van een nieuw vak aan de database, dan kan een professor hiervoor een formulier opstellen met daarin:\r\n• beschrijving van het vak\r\n• aantal studiepunten\r\n• nodige prerequisities\r\n• welk semester het vak gegeven wordt • aantal uren studie tijd\r\n• studiegidsnummer • 2e zittijd mogelijk • onderwijstaal\r\n• faculteit\r\n• verantwoordelijke vakgroep • onderwijsteam\r\n• onderdelen en contacturen • studiemateriaal\r\n• leerresultaten\r\n• beoordelingsinformatie\r\nHet formulier wordt dan gestuurd naar de Programmabeheerder die het vak zal toevoegen.', 'busy'),
(13, 'Requirement', '2013-11-04 03:44:28', '2014-03-18 16:09:55', 'FR2.07', 'Goedkeuren detail formulier', 'low', 'De professor moet al een detail formulier ingedient hebben', 'De programma beheerder bekijkt en ingediende formulier van een professor en beslist dit toe wel of niet toe te voegen aan het de database.', 'undefined'),
(14, 'Requirement', '2013-11-04 03:45:11', '2014-03-18 16:10:05', 'FR3.01', 'Lokaal detailformulier toevoegen', 'high', NULL, 'De Programmabeheerder moet in staat zijn om lokalen toe te voegen aan de database zodat de scheduler die kan gebruiken in zijn planning. Lokalen hebben een ID nummer van de vorm G.V.L (met G = gebouw, V = verdieping en L = lokaal) en hebben ook bepaalde faciliteiten (beamer, overheadprojector...) een maximaal aantal plaatsen,', 'busy'),
(15, 'Requirement', '2013-11-04 03:45:38', '2014-03-18 16:10:14', 'FR3.02', 'Lokaal detailformulier verwijderen', 'high', NULL, 'De Programmabeheerder moet in staat zijn lokalen te verwijderen (In het geval dat deze niet meer in gebruik worden genomen).', 'busy'),
(16, 'Requirement', '2013-11-04 03:45:58', '2014-04-22 12:13:51', 'FR3.03', 'Lokaal detailformulier aanpassen', 'medium', NULL, 'Mocht er nood zijn aan het aanpassen van een lokaal detailformulier, moet de programmabeheerder de optie hebben om dit te doen.', 'done'),
(22, 'Requirement', '2013-11-19 01:20:39', '2014-03-31 22:53:48', 'FR1.08', 'Beschikbaarheidsformulier aanmaken', 'low', NULL, 'Een gebruiker (van het type beschreven in toegang) heeft de optie om een formulier in te dienen waarin hij aangeeft wat zijn vrije momenten zijn om les te geven. De scheduler houdt hier dan rekening mee bij het opstellen van de lesroosters.', 'busy'),
(23, 'Requirement', '2013-11-19 01:25:08', '2014-03-18 16:10:33', 'FR2.08', 'Planning markeren als voorstel', 'medium', NULL, 'Een professor kan een voorstel indienen aan de Scheduler. Deze geeft dan in wanneer hij zijn vak het liefst zou geven en dan wordt dit doorgegeven aan de Scheduler die dan rekening probeert te houden met de ingegeven constraint. Dit staat los van de beschikbaarheid van de professor en lokalen.', 'undefined'),
(24, 'Requirement', '2013-11-19 01:25:41', '2014-04-22 12:22:38', 'FR2.09', 'Vakken verwijderen van lesprogramma', 'high', NULL, 'De Programmabeheerder kan ook vakken verwijderen uit lespro- gramma’s', 'busy'),
(25, 'Requirement', '2013-11-19 01:28:24', '2014-03-31 22:57:50', 'FR4.01', 'Uitvoeren van een full scheduling', 'high', NULL, 'De Scheduler moet in staat zijn om lesroosters op te kunnen stel- len, hierbij word er rekening gehouden met verschillende constraint: locatie, tijstip, studenten, professoren en assitenten.', 'busy'),
(26, 'Requirement', '2013-11-19 01:28:54', '2014-03-18 16:10:59', 'FR4.02', 'Goedkeuren van een scheduling', 'high', NULL, 'Een opgesteld lesrooster moet goedgekeurd worden door de programmabeheerder.', 'undefined'),
(27, 'Requirement', '2013-11-19 01:30:12', '2014-03-18 16:11:15', 'FR4.03', 'Professor, assistent en programmabeheerder moeten semi-scheduling laten uitvoeren (Haalbaarheid)', 'medium', NULL, 'Gebruiker (van type toegang) kunnen bekijken hoe haalbaar hun schema is. Dit zal een score zijn die afhankelijk is van het aantal beschikbare uren van de persoon en het aantal uren dat deze per- soon les zal moeten geven. (Vb: 12uur les te geven en 18u vrij zal een goede haalbaarheidsscore krijgen. 16u les en 10u vrij zal een score geven die overeenkomt met onmogelijk)', 'undefined'),
(28, 'Requirement', '2013-11-19 01:30:51', '2014-03-18 16:11:29', 'FR4.04', 'Rooster bevat data, tijdstippen en lokalen voor bepaalde vakken', 'high', NULL, 'Het rooster dat is opgesteld bevat alle informatie over elk vak dat nodig is om het vak te kunnen volgen.\r\n￼￼￼￼￼￼￼￼￼', 'undefined'),
(29, 'Requirement', '2013-11-19 01:31:22', '2014-04-22 12:45:29', 'FR4.05', 'Aanpassen berekend rooster', 'high', NULL, 'Het moet mogelijk zijn om een berekend lessenrooster aan te passen.', 'busy'),
(30, 'Requirement', '2013-11-19 01:31:54', '2014-03-18 16:17:26', 'FR5.01', 'Lesrooster van richting bekijken', 'high', NULL, 'Een (niet) ingelogde gebruiker heeft de optie om het standaard les- rooster van een bepaalde richting te bekijken. Hiervoor moet hij een richting en jaar uitkiezen uit een lijst van alle richtingen.', 'undefined'),
(31, 'Requirement', '2013-11-19 01:32:17', '2014-03-18 16:17:35', 'FR5.02', 'Lesrooster van specifiek vak bekijken', 'high', NULL, 'Een (niet)ingelogde gebruiker heeft de optie om het lesrooster van een bepaald vak te bekijken. Hiervoor moet hij  ́e ́en van de bestaande vakken aan de VUB kiezen.', 'undefined'),
(32, 'Requirement', '2013-11-19 01:32:50', '2014-03-18 16:17:47', 'FR5.03', 'Lesrooster van een lokaal bekijken', 'high', NULL, 'Een (niet) ingelogde gebruiker heeft de optie om het lesrooster van een leslokaal te bekijken, d.w.z. wanneer dat lokaal bezet is. Hiervoor moet de gebruiker zelf een les lokaal invullen van de vorm G.V.L (met G = gebouw, V = verdieping en L = lokaal)', 'undefined'),
(33, 'Requirement', '2013-11-19 01:33:28', '2014-03-18 16:17:55', 'FR5.04', 'Gepersonaliseerd lessenrooster bekijken', 'high', NULL, 'Een aangemelde gebruiker kan op elk moment zijn persoonlijk rooster opvragen. Voor studenten gaat dit over lessen volgen. Assistenten en professoren krijgen hier de lessen gepresenteerd die ze moeten geven. Een aangemelde student kan zijn eigen lesrooster bekijken, deze bevat alleen de vakken waarvoor de student ingeschreven is. Het lesrooster geeft aan waar en om hoe laat een vak gegeven wordt en kan waarschuwingen geven bij mogelijke overlappingen.', 'undefined'),
(34, 'Requirement', '2013-11-19 01:33:56', '2014-03-18 16:18:03', 'FR5.05', 'Gespecialiseerd schema opvragen lesgever', 'medium', NULL, 'Een professor kan zijn eigen schema van alle lessen bekijken die on- der zijn bevoegdheid vallen. Ook WPO’s die niet door de professor gegeven worden staan op deze speciale lijst. Verschil word aangeduid via kleurmarkeringen.', 'undefined'),
(35, 'Requirement', '2013-11-19 01:34:23', '2014-03-18 16:18:12', 'FR6.01', 'Bekijken lessenrooster als specifiek gebruiker', 'low', NULL, 'De Programmabeheerder kan via een naam en rolnummer het les- rooster van een specifieke gebruiker bekijken.', 'undefined'),
(36, 'Requirement', '2013-11-19 01:34:47', '2014-03-18 16:18:24', 'FR6.02', 'Bevriezen van een voorstel', 'medium', NULL, 'Een voorstel van een professor kan worden worden bevroren en de als het schema word aangemaakt ligt dit voorstel al vast', 'undefined'),
(37, 'Requirement', '2013-11-19 01:35:17', '2014-03-18 16:18:38', 'FR6.03', 'Bevriezen volledige planning', 'medium', NULL, 'Op het moment dat de planning vast is kunnen studenten deze be- kijken. Het moet echter nog mogelijk zijn om deze aan te passen en daarom is heeft de Programmabeheerder de optie om de volledige planning te bevriezen en onzichtbaar te maken voor studenten.', 'undefined'),
(38, 'Requirement', '2014-03-18 15:13:08', '2014-03-18 16:06:29', 'FR1.07', 'Profielgegevens aanpassen', 'medium', NULL, 'Een gebruiker kan zijn profielgegevens aanpassen. Meer bepaald kan hij de volgende informatie aanpassen:\r\n\r\nNaam\r\nVoornaam\r\nGebruikersnaam \r\nWachtwoord\r\nGeboortedatum \r\nEmail', 'done'),
(39, 'Requirement', '2014-03-18 15:14:47', '2014-03-18 16:07:15', 'FR1.09', 'Meertaligheid voorzien', 'high', NULL, 'Een gebruiker (van het type beschreven in toegang) moet de optie hebben op zijn taal aan te passen. Het programma zal minstens over 2 talen beschikken, namelijk Engels en Nederlands', 'done'),
(40, 'Requirement', '2014-03-18 15:16:52', '2014-04-22 12:16:25', 'FR1.10', 'Automatisch inloggen', 'medium', 'Gebruiker moet zich al eens ingelogd hebben', 'Een gebruiker (van het type beschreven in toegang) kan automatisch ingelogd worden als deze terugkomt naar de website van CalZone.', 'done'),
(41, 'Requirement', '2014-03-18 15:18:13', '2014-03-18 15:18:13', 'FR1.11', 'Profiel verwijderen', 'low', 'Gebruiker moet al een account hebben', 'Een gebruiker kan zijn account verwijderen', 'undefined'),
(42, 'Requirement', '2014-03-18 15:19:23', '2014-03-18 15:19:23', 'FR1.12', 'Confirmatie mail herzenden', 'high', 'Gebruiker moet al een account hebben', 'Een gebruiker heeft de mogelijkheid opnieuw zijn emailadres op te geven, om opnieuw een confirmatie mail te versturen. Nodig wanneer activatie-mail na registratie verloren is gegaan', 'undefined'),
(43, 'Requirement', '2014-03-18 15:20:25', '2014-04-22 12:20:56', 'FR1.13', 'Volgende les op profiel pagina', 'medium', 'Gebruiker moet al een account hebben', 'Een aangemelde gebruiker kan op zijn profiel pagina meteen zien wat zijn volgende les is, waar deze plaats vind en om hoe laat deze begint. Deze word steeds ge-update zodat de eerst volgende les getoond wordt.\r\n￼￼', 'done'),
(44, 'Requirement', '2014-03-18 15:22:50', '2014-03-18 16:18:53', 'FR3.04', 'GPS locatie', 'low', NULL, 'Elk lokaal moet voorzien zijn van een GPS locatie die opgevraagd kan worden.', 'undefined'),
(45, 'Requirement', '2014-03-18 15:24:04', '2014-03-18 16:19:09', 'FR4.06', 'Roostergoedkeuring', 'high', 'Er moet een rooster voorstel ingedient zijn', 'Als er een rooster voorstel is ingedient moet de programma die goed- keuren. Het ingediende voorstel bevat geen conflicten, daar word voor het inzenden al rekening mee gehouden.', 'undefined'),
(46, 'Requirement', '2014-03-18 15:25:20', '2014-03-18 16:19:20', 'FR4.07', 'Conflictdetectie', 'high', NULL, 'De Scheduler moet in staat zijn om conflicten te detecteren.\r\n\r\nConflicten zijn:\r\n1. Twee of meer vakken op hetzelfde moment of hetzelfde lokaal\r\n2. Een professor/assistent die twee of meer vakken op hetzelfde tijdstip moet geven\r\n3. Studenten die twee of meer vakken op hetzelfde tijdstip moeten volgen\r\n\r\nPuntje 1 en 2 zijn harde conflicten die altijd opgelost moeten worden. Ook verplichte vakken voor studenten van een bepaalde richting mo- gen nooit samenvallen. Bij keuzevakken is dit wel toegelaten maar niet gewenst.', 'undefined'),
(47, 'Requirement', '2014-03-18 15:27:03', '2014-03-18 16:19:36', 'FR6.04', 'Toegang gebruiker veranderen', 'medium', NULL, 'Een programmabeheerder kan het soort toegang dat een gebruiker heeft aanpassen, deze bepaalt van welke functionaliteiten een gebruiker allemaal gebruik van mag maken. Er zijn 4 soorten toegangkelijkheden:\r\n• Student\r\n• Assistent\r\n• Professor\r\n• Programmabeheerder', 'undefined'),
(48, 'Requirement', '2014-03-18 15:27:44', '2014-03-18 16:19:47', 'FR6.05', 'Gebruiker Verwijderen', 'medium', NULL, 'Een programmabeheerder kan gebruikers verwijderen uit de database.', 'undefined'),
(49, 'Requirement', '2014-03-18 15:29:09', '2014-03-18 16:20:00', 'FR7.01', 'Exporteren van kalender naar mobiele apparaten', 'medium', NULL, 'De applicatie moet toelaten om kalenders te importeren naar mobiele apparaten zoals smartphones.', 'undefined'),
(50, 'Requirement', '2014-03-18 15:29:52', '2014-03-18 16:20:11', 'FR7.02', 'GPS locatie identificatie', 'low', NULL, 'Met een mobiel apparaat is het mogelijk om samen met de GPS locatie van een lokaal, het lessenrooster van dat lokaal op te vragen.\r\n￼￼', 'undefined'),
(51, 'Requirement', '2014-03-18 15:30:33', '2014-03-18 16:20:21', 'FR7.03', 'Check-in functionaliteit', 'low', NULL, 'Een gebruiker kan aangeven dat deze zich in een les bevind door op een ”check-in”knop te drukken. Deze functionaliteit word ge ̈ımplementeerd om later mogelijke gamification technieken in de applicatie te implementeren.\r\n￼￼', 'undefined'),
(52, 'Requirement', '2014-03-18 15:31:18', '2014-03-18 16:20:32', 'FR7.04', 'Push notificaties', 'low', NULL, 'Een aangemelde gebruiker kan om zijn mobiele apparaten notificaties krijgen over zijn vakken (bijvoorbeeld dat deze van lokaal verandert is).\r\n￼￼', 'undefined'),
(53, 'Requirement', '2014-03-18 15:32:57', '2014-03-18 16:20:44', 'NFR1.01', 'Implementatie van HTTPS', 'medium', NULL, 'HTTPS gebruiken voor de beveiliging van de applicatie.', 'undefined'),
(54, 'Requirement', '2014-03-18 15:33:37', '2014-03-18 16:20:54', 'NFR1.02', 'Hashing', 'high', NULL, 'Wachtwoorden moeten in de database opgeslagen worden met be- hulp van een hash. Er zal gebruik gemaakt worden van SHA-256 als cryptografische hash functie en een SALT.', 'done'),
