(32, 'BlogEntry', '2013-11-15 05:10:03', '2014-04-21 18:03:51', 'communicatieplatform', 'Communicatieplatform', NULL, 'Beste teamleden, \n\ndit is een eerste bericht om te laten weten dat het communicatieplatform in werking is getreden. \nAls alles goed verloopt, zou dit bericht voor iedereen zichtbaar moeten zijn via de website: Team > Berichten. \nOok zou iedereen hiervan een melding via mail moeten hebben ontvangen, aangezien alle berichten worden bezorgd aan de mailbox van onze groep. \n\nJullie kunnen hier nu ook zelf berichten invullen. Merk wel op dat deze berichten ook als e-mail worden verstuurd. \nVermijd dus korte berichten die onze mail- en mogelijk spamfolder kunnen verzadigen. \n\nReacties kunnen worden geplaatst via Disqus. Om hier gebruik van te kunnen maken, dienen jullie zich aan te melden voor deze service: http://disqus.com. \nDit kan zowel via het onderstaande reactieformulier (Facebook, Google+, etc.) of via een eigen Disqus account. \nProbeer dit zodanig aan te passen dat dit in overeenstemming is met het profiel van de team website. \n\nAls laatste wil ik nog even meedelen dat alle opmerkingen of bugs niet als reactie worden gepost, maar als een issue in onze GitHub. \n\nMet vriendelijke groeten, \n\nChristophe \n\nP.S.: indien er problemen zijn bij het verzenden of opslaan van dit bericht, kan het zijn dat jullie dit meerdere keren ontvangen. Geen paniek dus als je deze mail meer dan één keer krijgt.', NULL, NULL, 0, 1, 1, 0, 0, NULL, 'Inherit', 'Inherit', 1, 22),
(33, 'BlogEntry', '2013-11-16 17:00:51', '2014-04-21 18:03:51', 'pizza', 'Pizza', NULL, 'De rekening voor de pizza''s:\n\n- Youri: 14€\n- Nicolas: 8€\n- Christophe: 8€\n- Pieter: 9€\n- Tim: 9€', NULL, NULL, 0, 1, 2, 0, 0, NULL, 'Inherit', 'Inherit', 1, 22),
(34, 'BlogEntry', '2013-11-18 23:21:00', '2014-04-21 18:03:51', 'vergadering-2111', 'Vergadering 21/11', NULL, 'We spreken af dat de volgende vergadering donderdag om 18u aanvangt. Daarna werken we in team samen verder aan het project. Ik zal de agenda tijdig online zetten (hier op het communicatieplatform, zodanig dat feedback mogelijk is).\n\nVoor Fernando & Sam, kunnen jullie er toch nog eens over nadenken om toch te komen ? Bij een groepswerk is samenwerken essentieel.\n\nMvg,\n\nPieter\n\n', NULL, NULL, 0, 1, 3, 0, 0, NULL, 'Inherit', 'Inherit', 1, 22),
(35, 'BlogEntry', '2013-11-29 00:51:25', '2014-04-21 18:03:51', 'time-tracking', 'Time Tracking', NULL, 'Ik heb ondertussen al goed verder gewerkt aan de link tussen java en de MySQL database. Een klein probleempje is wel dat het niet mogelijk is om rechtsreeks in de database op de wilma server te werken dus werk ik met een local MySQL server.\n\nBij het invullen van de Time Tracking vind ik bij activiteit wel geen dat "coding" heet ofzo, moet dat nog toegevoegd worden?', NULL, NULL, 0, 1, 4, 0, 0, NULL, 'Inherit', 'Inherit', 1, 22),
(36, 'MemberPage', '2013-12-17 18:02:55', '2014-04-21 18:03:51', 'details', 'Details', NULL, NULL, NULL, NULL, 1, 1, 1, 0, 0, NULL, 'OnlyTheseUsers', 'Inherit', 3, 18),
(37, 'BlogEntry', '2014-02-14 11:17:35', '2014-04-21 18:03:51', 'herinnering-time-tracking', 'Herinnering Time Tracking', NULL, 'Herinnering dat iedereen zijn time tracking invult ;)', NULL, NULL, 0, 1, 5, 0, 0, NULL, 'Inherit', 'Inherit', 1, 22),
(38, 'StatPage', '2014-03-24 13:58:23', '2014-04-21 18:03:51', 'statistieken', 'Statistieken', NULL, NULL, NULL, NULL, 1, 1, 3, 0, 0, NULL, 'Anyone', 'Inherit', 9, 16),
