(86, 28, 1, 1, 2, 2, 'BlogEntry', '2013-11-15 03:55:11', '2013-11-15 03:55:11', 'testbericht-communicatieplatform', 'Testbericht communicatieplatform', NULL, 'Beste teamleden,\n\ndit is een eerste bericht om te laten weten dat het communicatieplatform in werking is getreden.\nAls alles goed verloopt, zou dit bericht voor iedereen zichtbaar moeten zijn via de website: Team > Berichten.\nOok zou iedereen hiervan een melding via mail moeten hebben ontvangen, aangezien alle berichten worden bezorgd aan de mailbox van onze groep.\n\nJullie kunnen hier nu ook zelf berichten invullen. Merk wel op dat deze berichten ook als e-mail worden verstuurd.\nVermijd dus korte berichten die onze mail- en mogelijk spamfolder kunnen verzadigen.\n\nReacties kunnen worden geplaatst via Disqus.\nOm hier gebruik van te kunnen maken, dienen jullie zich aan te melden voor deze service: http://disqus.com.\nDit kan zowel via het onderstaande reactieformulier (Facebook, Google+, etc.) of via een eigen Disqus account.\nProbeer dit zodanig aan te passen dat dit in overeenstemming is met het profiel van de team website.\n\nAls laatste wil ik nog even meedelen dat alle opmerkingen of bugs niet als reactie worden gepost,\nmaar als een issue in onze GitHub.\n\nMet vriendelijke groeten,\n\nChristophe\n\nP.S.: indien er problemen zijn bij het verzenden of opslaan van dit bericht, kan het zijn dat jullie dit meerdere keren ontvangen.\nGeen paniek dus als je deze mail meer dan één keer krijgt.', NULL, NULL, 0, 1, 0, 0, 0, NULL, 'Inherit', 'Inherit', 22),
(87, 28, 2, 0, 2, 0, 'BlogEntry', '2013-11-15 03:55:11', '2013-11-15 03:55:11', 'testbericht-communicatieplatform', 'Testbericht communicatieplatform', NULL, 'Beste teamleden,\n\ndit is een eerste bericht om te laten weten dat het communicatieplatform in werking is getreden.\nAls alles goed verloopt, zou dit bericht voor iedereen zichtbaar moeten zijn via de website: Team > Berichten.\nOok zou iedereen hiervan een melding via mail moeten hebben ontvangen, aangezien alle berichten worden bezorgd aan de mailbox van onze groep.\n\nJullie kunnen hier nu ook zelf berichten invullen. Merk wel op dat deze berichten ook als e-mail worden verstuurd.\nVermijd dus korte berichten die onze mail- en mogelijk spamfolder kunnen verzadigen.\n\nReacties kunnen worden geplaatst via Disqus.\nOm hier gebruik van te kunnen maken, dienen jullie zich aan te melden voor deze service: http://disqus.com.\nDit kan zowel via het onderstaande reactieformulier (Facebook, Google+, etc.) of via een eigen Disqus account.\nProbeer dit zodanig aan te passen dat dit in overeenstemming is met het profiel van de team website.\n\nAls laatste wil ik nog even meedelen dat alle opmerkingen of bugs niet als reactie worden gepost,\nmaar als een issue in onze GitHub.\n\nMet vriendelijke groeten,\n\nChristophe\n\nP.S.: indien er problemen zijn bij het verzenden of opslaan van dit bericht, kan het zijn dat jullie dit meerdere keren ontvangen.\nGeen paniek dus als je deze mail meer dan één keer krijgt.', NULL, NULL, 0, 1, 1, 0, 0, NULL, 'Inherit', 'Inherit', 22),
(88, 29, 1, 1, 2, 2, 'BlogEntry', '2013-11-15 04:02:36', '2013-11-15 04:02:36', 'testbericht-communicatieplatform-2', 'Testbericht communicatieplatform', NULL, 'Beste teamleden, \r\n\r\ndit is een eerste bericht om te laten weten dat het communicatieplatform in werking is getreden. \r\nAls alles goed verloopt, zou dit bericht voor iedereen zichtbaar moeten zijn via de website: Team > Berichten. \r\nOok zou iedereen hiervan een melding via mail moeten hebben ontvangen, aangezien alle berichten worden bezorgd aan de mailbox van onze groep. \r\n\r\nJullie kunnen hier nu ook zelf berichten invullen. Merk wel op dat deze berichten ook als e-mail worden verstuurd. \r\nVermijd dus korte berichten die onze mail- en mogelijk spamfolder kunnen verzadigen. \r\n\r\nReacties kunnen worden geplaatst via Disqus. Om hier gebruik van te kunnen maken, dienen jullie zich aan te melden voor deze service: http://disqus.com. \r\nDit kan zowel via het onderstaande reactieformulier (Facebook, Google+, etc.) of via een eigen Disqus account. \r\nProbeer dit zodanig aan te passen dat dit in overeenstemming is met het profiel van de team website. \r\n\r\nAls laatste wil ik nog even meedelen dat alle opmerkingen of bugs niet als reactie worden gepost, maar als een issue in onze GitHub. \r\n\r\nMet vriendelijke groeten, \r\n\r\nChristophe \r\n\r\nP.S.: indien er problemen zijn bij het verzenden of opslaan van dit bericht, kan het zijn dat jullie dit meerdere keren ontvangen. Geen paniek dus als je deze mail meer dan één keer krijgt.', NULL, NULL, 0, 1, 1, 0, 0, NULL, 'Inherit', 'Inherit', 22),
