(50, 'TimeTrack', '2013-11-03 22:26:55', '2013-11-21 21:51:52', 'Herschikken SRS + lezen', 5, 'Het document op ShareLatex aangepast naar VUB-stijl en start lezen SRS standaard tot pagina 15', '2013-11-02 22:36:00', '2013-11-03 00:15:00'),
(51, 'TimeTrack', '2013-11-03 22:29:09', '2013-11-21 21:52:03', 'Lezen SRS + opzoekingswerk', 5, 'Verder lezen van de SRS standaard tot pagina 20 en vervolgens info omtrend constraint programming opgezocht die later eventueel van pas kan komen', '2013-11-03 10:45:00', '2013-11-03 12:00:00'),
(52, 'TimeTrack', '2013-11-03 22:31:19', '2013-11-21 21:52:14', 'Werken aan SRS', 5, 'In samenwerking met Tim via Google Hangout verdergewerkt aan de inhoud en layout van het SRS document. Tim heeft iets langer doorgewerkt, omdat ik moest gaan eten.', '2013-11-03 13:30:00', '2013-11-03 15:30:00'),
(53, 'TimeTrack', '2013-11-03 22:36:53', '2013-11-21 21:52:23', 'SRS (opmaak)', 5, 'Knoeien aan de layout van het SRS document terwijl Fernando en Tim inhoud opleverde.\r\nWat valt er onder knoeien te verstaan:\r\n- herschikken tex-files\r\n- opzoekingswerk (om zaken gedaan te krijgen)\r\n- zoektocht naar modulariteit van de componenten\r\n- erachter komen dat sharelatex de nodige package niet bezit hiervoor\r\n- die mensen mailen in de hoop dat ze het zullen installeren\r\n- hard coderen van inclusions\r\n- gedoe met tabellen fixen (ze zaten gedurig door elkaar gegooid)\r\n- uiteindelijk terug een compileerbaar en leesbaar document bekomen', '2013-11-03 17:00:00', '2013-11-03 22:20:00'),
(54, 'TimeTrack', '2013-11-04 01:45:25', '2013-11-21 21:53:32', 'Teammeeting', 2, 'Gedetailleerd overlopen van hoofdpunten SPMP met bijhorende taakverdeling, samen met Pieter en Nicolas.', '2013-10-29 17:00:00', '2013-10-29 19:00:00'),
