(77, 'TimeTrack', '2013-11-13 17:21:27', '2013-11-21 22:23:29', 'Website communicatie', 2, 'Ontwerp en coderen van een communicatiesectie voor de team website.\r\n- Layout & code van berichtensysteem zelf op basis van een blog,\r\n- Koppelen van berichten aan leden,\r\n- Wijzigen toestemmingen/rechten om berichten te kunnen aanmaken zonder andere berichten te kunnen aanpassen.\r\n\r\nOnline plaatsen van kalender en berichten (nog aan het testen met mail).\r\n\r\nBezig met:\r\n- WYSIWYG editor voor nieuwsberichten (10%),\r\n- Integratie van Disqus voor het geven van commentaar op berichten(90%),\r\n- e-mail integratie voor verzending van berichten bij het plaatsen van een nieuw bericht (50%).', '2013-11-13 12:00:00', '2013-11-13 17:15:00'),
